import Navbar from "../components/NavBar";
import Footer from "../components/Footer";
import closed from '../img/icon-x.png'

const RootPage = () => {

return(
<>
<div style={{'background': 'orange'}} className='col-6'>
<a href="/">
<img src={closed} alt='icona closed'
style={{'width': '30px'}}
></img></a> 
</div>
<Navbar></Navbar>
<Outlet></Outlet>
<Footer></Footer>
</>
)};

export default RootPage;
